import React, { useState, useEffect } from "react";
import axios from "axios";
import {AvatarWoman, AvatarMan} from "../common/icons/icons.jsx"
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

const TableEmployee = () => { 

    
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { isError
  //,user
  } = useSelector((state) => state.auth);

  useEffect(() => {
    dispatch(getMe());
  }, [dispatch]);

  useEffect(() => {
    if (isError) {
      navigate("/");
    }
    // if(user && user.role !== "admin"){
    //   navigate("/dashboard");
    // }
    // opcja dostępu inny niz admin do dashboard
  }, [isError,
    //user,
    
    navigate]);
return (
    <div>
      <table>
        <thead>
          <tr>
            <th>ID:</th>
            <th>Imie Nazwisko</th>
            <th>Stanowisko</th>
            <th>Oddział</th>
            <th>Email</th>
            <th>Doświadczenie</th>
            <th>Umowa</th>
            <th>Opcje</th>
          </tr>
        </thead>
        
        <tbody>
          {user.map((user, index) => (
            <tr key={user.uuid} className="employee-tr">
              <td>
                 {index + 1} 
         
              </td>
              <td className="employee-profile">      {
               user.sex === "kobieta"?
                <div className="user-avatar">
                <AvatarWoman className="employee-icon"/>
                </div>
               :
                <AvatarMan className="employee-icon"/>
               }
              {user && `${user.name} ${user.surname}`}</td>
              <td>{user.position} {user.role}</td>
              <td>Mników</td>
              <td>{user.email}</td>
              <td>1rok</td>
              <td>{user.agreement} </td>
              <td>
                <Link to={`/products/edit/${user.uuid}`}>,</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TableEmployee;
